package info.kernelhcy.leetcode;

public class P214
{
    public static void main(String[] args)
    {
        System.out.println(new Solution().shortestPalindrome("aacecaaa"));
        System.out.println(new Solution().shortestPalindrome("abcd")); // dcba
        System.out.println(new Solution().shortestPalindrome("a"));
        System.out.println(new Solution().shortestPalindrome("ab"));
        System.out.println(new Solution().shortestPalindrome(""));
    }

    public static class Solution
    {
        public String shortestPalindrome(String s)
        {
            String r = new StringBuilder(s).reverse().toString();
            int[] next = getNextArray(s + '#' + r);

            return r.substring(0, r.length() -  next[r.length() * 2 + 1]) + s;
        }

        private int[] getNextArray(String p)
        {
            int[] next = new int[p.length() + 1];
            next[0] = -1;
            int i = 1;
            int k = -1;
            while (i <= p.length()) {
                if (k == -1 || p.charAt(k) == p.charAt(i - 1)) {
                    ++k;
                    next[i] = k;
                    ++i;
                } else {
                    k = next[k];
                }
            }

            return next;
        }

        /**
         * Time Limited Exceeded
         *
         * @param s
         * @return
         */
        public String shortestPalindrome2(String s)
        {
            if (isPalindrome(s)) return s;

            StringBuilder sb = new StringBuilder();
            for (int i = s.length() - 1; i >= 0; --i) {
                sb.append(s.charAt(i));
                if (isPalindrome(s.substring(0, i))) return sb.toString() + s;
            }
            return "";
        }

        private boolean isPalindrome(String s)
        {
            if (s.length() <= 0) return true;
            int begin = 0, end = s.length() - 1;
            while (begin <= end) {
                if (s.charAt(begin) == s.charAt(end)) {
                    ++begin;
                    --end;
                    continue;
                }

                return false;
            }
            return true;
        }
    }
}
